import React from 'react';
import './Header.css';

export default class Header extends React.Component {
    constructor(props) {
        super(props);
        
        this.trees = [
            "Binary Search Tree",
            "AVL Tree",
            "Red-Black Tree"
        ];

        this.state = {
            active: "Binary Search Tree"
        };
    }

    render() {
        return (
            <>
                <div id="header-wrapper">Hello</div>
            </>
        );
    }
}
